import React, { Component } from 'react'
import './Navbar.css'

class Navbar extends Component {
  render () {
    return (
      <nav className='navbar-main'>
         <img src="" className='navbar-logo' alt='logo'></img>
      </nav>
    );
  }
}

export default Navbar;
